import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "../styles/Clientes.css";

const Clientes = () => {
  const navigate = useNavigate();

  // Lista mockada de clientes
  const clientes = [
    { id: 1, nome: "João Silva", dataNascimento: "01/01/2000" },
    { id: 2, nome: "Antonio Araújo", dataNascimento: "30/05/2003" },
  ];

  return (
    <div className="clientes">
      <h2>Visualizar Clientes</h2>
      <div className="search-bar">
        <input type="text" placeholder="Buscar Clientes" />
        <button>
          <img src="search-icon.png" alt="Buscar" />
        </button>
      </div>
      <div className="clientes-lista">
        {clientes.map((cliente) => (
          <div
            key={cliente.id}
            className="cliente-card"
            onClick={() => navigate(`/clientes/${cliente.id}`)}
          >
            <p><strong>Nome:</strong> {cliente.nome}</p>
            <p><strong>Data de Nascimento:</strong> {cliente.dataNascimento}</p>
          </div>
        ))}
      </div>
      <Link to="/clientes/novo" className="botao-novo-cadastro">
        Novo Cadastro
      </Link>
    </div>
  );
};

export default Clientes;
